PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE Wine (_id INTEGER PRIMARY KEY AUTOINCREMENT, Name TEXT NOT NULL, Year SMALLINT CHECK (Year BETWEEN 0 AND 9999), Description TEXT, Color TEXT NOT NULL CHECK (COLOR IN ("Red", "White")), Rating TINYINT NOT NULL DEFAULT 0 CHECK (Rating BETWEEN 0 AND 5), NumRatings INTEGER NOT NULL DEFAULT 0);
CREATE TABLE Variety (_id INTEGER PRIMARY KEY AUTOINCREMENT, Name TEXT UNIQUE NOT NULL);
CREATE TABLE Vineyard (_id INTEGER PRIMARY KEY AUTOINCREMENT, Name TEXT UNIQUE NOT NULL, Region TEXT);
CREATE TABLE Descriptor (_id INTEGER PRIMARY KEY AUTOINCREMENT, Name TEXT UNIQUE NOT NULL);
CREATE TABLE Wine_Variety (_id INTEGER PRIMARY KEY AUTOINCREMENT, Wine_ID INTEGER REFERENCES Wine(ID) ON DELETE CASCADE, Variety_ID INTEGER REFERENCES Variety(ID) ON DELETE CASCADE);
CREATE TABLE Wine_Descriptor (_id INTEGER PRIMARY KEY AUTOINCREMENT, Wine_ID INTEGER REFERENCES Wine(ID) ON DELETE CASCADE, Descriptor_ID INTEGER REFERENCES Descriptor(ID) ON DELETE CASCADE);
CREATE TABLE Wine_Vineyard (_id INTEGER PRIMARY KEY AUTOINCREMENT, Wine_ID INTEGER REFERENCES Wine(ID) ON DELETE CASCADE, Vineyard_ID INTEGER REFERENCES Vineyard(ID) ON DELETE CASCADE);
DELETE FROM sqlite_sequence;
COMMIT;
