INSERT INTO "Wine" VALUES(2144,'Chateau Lafon-Rochet (Futures Pre-sale) 2011',0,'Chateau Lafon-Rochet has smooth tannins, beautiful balance, a silky texture, and is altogether sensual. Just as grandma''s old apple tree at the bottom of the garden has tastier apples, grapes from old vines product wine with more flavor and concentration. Although they produce less, their fruit reflects the terroir more faithfully. Lafron-Rochet is both simple and complex, with black fruit aromas in most vintages. It exemplifies a smoothness and expression unique to Saint-Estephe, as well as a certain warmth and elegant roundness due to the Merlot grape.','Red',0,0);
